import React from 'react';
import { Container } from 'react-bootstrap';

const Footer = () => {
    return (
        <footer style={ {
            width: '100%',
            position: 'relative',
            button: 0,
            display: 'flex',
            justifyContent: 'center'
        } }>
            <Container></Container>
        </footer>
    );
};

export default Footer;
